    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) WHERE - 56 < + + 7 AND 62 NOT BETWEEN - col2 / 53 + col1 * col2 AND col2;
  - name: tab1

outputs:
  - name: q10599.out
    data: |
      51	14	96
      85	5	59
      91	47	68
